import React, { useState } from 'react';
import ClaimList from './ClaimList';

function FailureExplorer() {
  const failureTypes = [
    { key: 'overconfident_hallucination', label: 'Overconfident Hallucination' },
    { key: 'conflicting_sources', label: 'Conflicting Sources' },
    { key: 'outdated_data', label: 'Outdated Data' }
  ];
  // Mock sample data for each failure type
  const sampleData = {
    overconfident_hallucination: {
      query: 'What are the health benefits of eating kale?',
      answer: 'Kale is known to cure cancer and boost health. ' +
              'It has 100mg of Vitamin C in each leaf.【ref】 ' +
              'It is extremely rich in fiber and vitamins.',
      claims: [
        {
          text: 'Kale is known to cure cancer.',
          verdict: 'Contradicted',
          evidence: [
            { docName: 'Health Journal', chunkId: 12,
              text: 'No evidence that kale cures cancer; no studies supporting such a claim.' },
          ]
        },
        {
          text: 'Each kale leaf has 100mg of Vitamin C.',
          verdict: 'No Evidence',
          evidence: [
            { docName: 'Nutrition Facts', chunkId: 7,
              text: 'Kale contains about 80mg of Vitamin C per serving (100g), not per leaf.' },
          ]
        },
        {
          text: 'Kale is extremely rich in fiber and vitamins.',
          verdict: 'Supported',
          evidence: [
            { docName: 'Nutrition Facts', chunkId: 8,
              text: 'Kale is high in dietary fiber and vitamins, as supported by USDA data.' },
          ]
        }
      ],
      reasons: [
        'Claims of curing cancer are hallucinated (unsupported by evidence).',
        'Vitamin C amount per leaf is exaggerated.',
        'Answer provides some factual info but mostly overstated.'
      ]
    },
    conflicting_sources: {
      query: 'What was the average global temperature in 2020?',
      answer: 'According to WHO, the average global temperature in 2020 was 14.5\u00B0C. ' +
              'However, NASA reports it was 14\u00B0C. ' +
              'Other sources say around 14\u00B0C as well.',
      claims: [
        {
          text: 'WHO reports 2020 average temperature as 14.5\u00B0C.',
          verdict: 'No Evidence',
          evidence: [
            { docName: 'No WHO Climate Report', chunkId: 5,
              text: 'Search reveals no WHO report stating 14.5\u00B0C for 2020.' },
          ]
        },
        {
          text: 'NASA reports the 2020 average as 14\u00B0C.',
          verdict: 'Contradicted',
          evidence: [
            { docName: 'NASA Report', chunkId: 3,
              text: 'NASA data indicates 2020 global average was 14.8\u00B0C, not 14\u00B0C.' }
          ]
        },
        {
          text: 'The global average is roughly 14\u00B0C.',
          verdict: 'Supported',
          evidence: [
            { docName: 'NOAA Data', chunkId: 6,
              text: 'Multiple datasets confirm around 14\u00B0C as the 2020 global average.' }
          ]
        }
      ],
      reasons: [
        'Different sources report conflicting temperature values.',
        'Answer cites a WHO figure that does not exist.',
        'Overall data is inconsistent and conflicting.'
      ]
    },
    outdated_data: {
      query: 'How many monthly active users does Instagram have?',
      answer: 'Instagram had 800000000 users in 2017 and 1000000000 users in 2018. ' +
              'As of 2020, it reached these numbers.【source】',
      claims: [
        {
          text: 'Instagram had 800000000 users in 2017.',
          verdict: 'No Evidence',
          evidence: [
            { docName: 'Stats Report', chunkId: 2,
              text: 'User count in 2017 was reported as 700M, not 800M.' }
          ]
        },
        {
          text: 'Instagram had 1000000000 users in 2018.',
          verdict: 'Contradicted',
          evidence: [
            { docName: 'TechCrunch', chunkId: 4,
              text: 'Instagram surpassed 1.2 billion users by 2020, so 1.0B in 2018 is outdated.' }
          ]
        },
        {
          text: 'Instagram user base grew rapidly from 2017 to 2020.',
          verdict: 'Supported',
          evidence: [
            { docName: 'Meta Earnings', chunkId: 1,
              text: 'Meta reports show rapid growth of Instagram user base over these years.' }
          ]
        }
      ],
      reasons: [
        'User count data is outdated and contradicts newer reports.',
        'Citing old figures gives an incorrect current picture.',
        'Answer relies on old sources rather than latest data.'
      ]
    }
  };
  const [selected, setSelected] = useState(failureTypes[0].key);

  return (
    <div className="flex h-[calc(100vh-64px)]">
      {/* Sidebar for failure types */}
      <nav className="w-1/4 bg-gray-100 dark:bg-gray-800 p-4 space-y-2">
        {failureTypes.map((type) => (
          <button
            key={type.key}
            onClick={() => setSelected(type.key)}
            className={
              'block text-left w-full px-4 py-2 rounded ' +
              (selected === type.key
                ? 'bg-blue-600 text-white'
                : 'hover:bg-gray-200 dark:hover:bg-gray-700')
            }
          >
            {type.label}
          </button>
        ))}
      </nav>

      {/* Details panel */}
      <div className="flex-1 p-4 overflow-y-auto">
        <h2 className="text-lg font-bold mb-2">Sample Query</h2>
        <div className="italic bg-white dark:bg-gray-800 p-2 rounded mb-4">
          {sampleData[selected].query}
        </div>
        <h2 className="text-lg font-bold mb-2">Model Answer</h2>
        <div className="bg-white dark:bg-gray-800 p-2 rounded mb-4">
          {sampleData[selected].answer}
        </div>
        <ClaimList claims={sampleData[selected].claims} />
        <div className="mt-6">
          <h3 className="text-xl font-semibold mb-2">Why this answer is unsafe</h3>
          <ul className="list-disc list-inside space-y-1 text-gray-700 dark:text-gray-300">
            {sampleData[selected].reasons.map((r, i) => (
              <li key={i}>{r}</li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
}

export default FailureExplorer;
